style.css:
/* Change the background color of the body */
body {
    background-color: #f0f0f0;
}

/* Change the text color of paragraphs */
p {
    color: #333;
}

/* Add a box shadow to images */
img {
    box-shadow: 5px 5px 5px #888888;
}

/* Customize the font */
body {
    font-family: 'Arial', sans-serif;
}

/* Add a border to all links */
a {
    border-bottom: 1px dashed #0077cc;
    text-decoration: none;
    color: #0077cc;
}

/* Change the hover effect for links */
a:hover {
    color: #004466;
    border-bottom: 1px solid #004466;
}
